import React from 'react';
import styles from "./styles.module.scss";
import Map from 'react-map-gl';

function Home() {
    return (
        <div className={styles.container}>
            <Map
                mapboxAccessToken=""
                initialViewState={{
                    longitude: -22.4,
                    latitude: 37.8,
                    zoom: 14
                }}
                style={{width: 600, height: 400}}
                mapStyle="mapbox://styles/mapbox/streets-v9"
            />
        </div>
    );
}

export default Home;
